const axios = require("axios").default;

const postProduct = async (data) => {
    if (axios) {
        const resp = await axios.post("http://localhost:3001/stocks", {
            productName: data,
            description: data,
            price: data,
            amount: data
        })
        return resp;   
    }
}

module.exports = {
    postProduct
}
